INSERT INTO `product_details` VALUES ('59', '2018110801', '06c792e2-0e6d-4a1a-a808-ef0faeca2f26', '产品介绍一', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541762352268_62474200f9d74ea3b5d441b1db92e4c4_th.jpg', '龙泉驿水蜜桃有40多个品种，主推的有20多个品种，包括春蕾、京春、早香玉、庆丰、春蜜、春雪、早春、霞晖6号等。 [3] \n龙泉驿水蜜桃特点是果形圆而不正，果皮底色乳白向阳面、顶部及缝合处侧著红晕，果肉白里透红、溶质，肉质致密，纤维少，汁液多，水分饱满，风味浓郁，香甜可口，色泽艳丽。 [4] \n龙泉水蜜桃不同月份有不同的品类，6月盛产春蕾，7月盛产松森、白凤，8月盛产惊艳，7月下旬到8月上旬出产的晚湖景也是上佳品类。而不同月份出产的水蜜桃，在口感上也略有不同，比如6月的松森，其特点就是果色亮丽、果肉细腻，脆甜、糖度较高，而7-8月出产晚湖景果色鲜艳、果肉细腻糖度极高。所以在不同月份选择不同的水蜜桃也是一门学问。龙泉驿水蜜桃生长在温暖湿润、光热充足、以黄壤土或紫色土为主的龙泉山脉的低山和浅丘地区，土壤营养丰富，微酸或中性，保水保肥性能强，冬季7.2℃以下的常年低温量能满足大多数桃树品种的生长需求，桃生长期的月平均气温可达到23℃-25℃，龙泉驿区科学利用了当地自然资源，以特色的栽培管理技术，孕育了产品的独特品质。');
INSERT INTO `product_details` VALUES ('60', '2018110802', '06c792e2-0e6d-4a1a-a808-ef0faeca2f26', '产品介绍二', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\002iau4Pzy6KvW34j5j25&690.jpg', '四川省成都市龙泉驿区的水蜜桃在明崇祯年间（1610年），就开始种植，已有400多年历史。\n清末，开始种植红花桃、白花桃品种，有200多年种植历史。\n20世纪30年代，龙泉驿区开始现代桃树栽培。\n20世纪50年代开始，“龙泉驿水蜜桃”长期被列为特供水果运送北京，供中央领导招待贵宾。\n1994年，龙泉驿区水蜜桃优质丰产配套技术推广项目获得国家农业部丰收计划一等奖。\n1995年，龙泉驿区被国务院有关部门命名为“中国水蜜桃之乡”、“中国名特优经济林水蜜桃之乡”。\n龙泉驿水蜜桃以其白里透红、香脆可口的独特口味和良好声誉占领了西宁、乌鲁木齐、兰州等北方市场；开辟了广州、珠海等南方市场，并销往新加坡、马来西亚、泰国、中国香港、中国澳门等东南亚国家和地区，形成了固定销售网络。龙泉驿是中国三大水蜜桃基地之一，水蜜桃产量占四川省市场的30%以上，产销率始终保持在98%以上。\n2008年，龙泉驿区水蜜桃种植面积8万余亩，产量达6813万余公斤，产值达1.9亿多元。形成了以山泉镇为中心沿龙泉山脉向南北延伸，连绵30余千米的国内罕见的水蜜桃种植带。 [6] \n龙泉驿充分发挥特有的资源优势，大力发展桃花经济，建设相关旅游风景区，到21世纪初，已拥有300多处成片景点，游览观赏面积达234平方千米。1987年开始举办的“中国·成都国际桃花节”品牌价值超过1亿元。2009年接待游客达450万人次，旅游收入10亿元以上。 [7] \n2010年，“龙泉驿水蜜桃”种植面积8万余亩，年产量达6.81万吨。 [7] \n2017年，龙泉驿水蜜桃种植面积达到20万亩，产量约10万吨，水蜜桃出口量达到300吨。');
INSERT INTO `product_details` VALUES ('61', '2018110803', '06c792e2-0e6d-4a1a-a808-ef0faeca2f26', '产品介绍三', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\u=3196307564,963553895&fm=26&gp=0.jpg', '龙泉驿区先后被国家、省、市确定为开发农业示范区、财政部农业科技推广示范园区、中国名特优经济林基地、中国园艺产品出口示范区、国家级无公害水果生产示范基地，被评为“中国水蜜桃之乡”、“四川省早熟梨之乡”、“优秀花果山风景名胜区”等。\n1996年，龙泉驿区选送的白凤桃获得中国博览会银奖。\n2004年09月27日，原国家质检总局批准对“龙泉驿水蜜桃”实施原产地域产品保护');
INSERT INTO `product_details` VALUES ('62', '2018110804', '06c792e2-0e6d-4a1a-a808-ef0faeca2f26', '产品介绍四', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\videos\\1541762366040_成都龙泉驿形象宣传片 超清(720P).MP4', '每年进入6月，都是龙泉驿当地种植户最为繁忙的季节，漫山遍野的水蜜桃点缀着这个川西平原东部的城镇，空气中都透着丝丝的芳香甜意。\n\n　　昨日，成都商报记者从龙泉驿当地几家大型水蜜桃专业合作社以及京东、淘宝等多个大型电商平台了解到，今年气候因素利好，龙泉驿水蜜桃的品质和口感更胜往年。因此，虽然7月销售旺季还未到来，但龙泉驿水蜜桃已经率先火爆市场，成为国内外采购商竞相订货的“香饽饽”，多个品种甚至出现“一桃难求”的情况。\n\n　　有着“天下第一桃”美誉的龙泉驿水蜜桃价格并不算便宜，但是其市场认可度却如此之高。究竟龙泉驿水蜜桃为何这么火？国内外客商为何会如此追捧？昨日，成都商报记者探访了龙泉驿区优质水蜜桃的核心产区，为您一一揭晓答案。来到龙泉山上的柏合镇长松村，沿途果农挑着、提着的篮筐里，一个个又大又红的桃子看得人直流口水。“我们的水蜜桃都是送到合作社的，那边统一接单销售，我们只管种好桃子就是了。”在当地拥有17亩果园的种植户王树根说，这段时间，他忙得像个陀螺，每天都要现摘三四百斤新鲜水蜜桃送去合作社。\n\n　　“自从加入了合作社，有专家给我们指导种植技术，不仅产量稳定，而且果子的质量都得到了提高，最直接的好处就是每年的收入实实在在提高了。”王树根言谈中难掩一脸喜色，他告诉记者，从6月1日到现在，他家的早熟品种水蜜桃已经卖出2.5万元，“接下来还有白凤桃、皮球桃等，预计今年的水蜜桃收入会有十多万元。”');
INSERT INTO `product_details` VALUES ('63', '2018110805', 'a82e9413-a8f8-4dbb-bab8-a3b4e2a7ffdc', '产品介绍一', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541762513617_timg.jpg', '相传，素有“籽粒透明似珍珠，果味浓甜似蜂蜜”的美誉的会理石榴，在唐朝时被唐玄宗相中，钦定为宫廷贡品，每年中秋由南诏王送入宫中，而一直到近当代，会理石榴也一直是石榴中的上品。1990年，北京亚运会指定要6000个会理精选石榴作为赠送各国来宾的佳品。 [4] \n2007年06月26日，原国家质检总局批准对“会理石榴”实施地理标志产品保护。会理石榴果大、色艳、皮薄、粒软、味浓、有微香、余味长，含有人体所需的多种维生素和氨基酸，可食部分百分率较高，可溶性固性物含量较高，籽粒“透明晶亮若珍珠，果味浓甜如蜂蜜”，品质佳良。四川省凉山彝族自治州会理县位于西南横断山脉东北部，青藏高原东南边缘，地处川滇交汇之处，区域内气候属国内中亚热带西部半湿润气候区，日照充足，热量丰富，昼夜温差大，蒸发旺盛，雨量集中，干湿季分明，具有发展优质石榴的自然生态条件，是中国最佳石榴适宜区之一。');
INSERT INTO `product_details` VALUES ('64', '2018110806', 'a82e9413-a8f8-4dbb-bab8-a3b4e2a7ffdc', '产品介绍二', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\timg (6).jpg', '会理石榴栽培历史悠久，早在唐朝时期即为皇帝御定贡品，每年由南诏王送入皇宫。 [6] \n《会理州志》记载：“榴，则名曰若榴，曰丹若，曰金罂，曰天浆，曰朱实，曰朱英，曰金英；有甜、酸二种，俗称石榴”。 [7] \n1966年，关河乡将会理石榴中的上品单果重达1千克以上的菜籽园石榴寄送毛泽东主席。\n改革开放以来，会理石榴实现产业化经营、种植面积达130万亩，栽植总株数达8000万株，果品年产量近100万吨，销往广州、深圳、北京、哈尔滨、杭州、上海等地，并出口东南亚各国及俄罗斯等国。\n1990年，北京亚运会采购了6000个会理精选石榴。2007年实施保护前，会理石榴年产量为7.8万吨，年产值3.2亿元，出口量0.68万吨，实施保护后，年产量达24.8万吨，年产值9.1亿元，出口量3.2万吨。 [1] \n2012年，会理石榴种植面积28万亩，石榴果品产量30万吨，果农收入10亿元。 [8] \n2014年，会理石榴种植面积达到30万亩，石榴果品产量达到35万吨，果农收入14亿元。会理石榴种植规模、产量、产值均稳居中国十大石榴产区之首。 [9] \n2016年，会理石榴产区已经扩大至全县22个乡（镇）的109个村社，种植面积达23200公顷，产量50万吨左右，实现石榴销售收入17亿余元。');
INSERT INTO `product_details` VALUES ('65', '2018110807', 'a82e9413-a8f8-4dbb-bab8-a3b4e2a7ffdc', '产品介绍三', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\timg (8).jpg', '1990年9月，会理石榴被农牧渔业部征集为“第十一届亚运会”展销果。 [1] \n1995年，会理石榴在第二届中国农业博览会上，获得金奖。 [1] \n1997年，会理石榴在第三届中国农业博览会上被认定为“名牌产品”。 [1] \n2002年，会理石榴在四川·中国西部农业博览会上被认定为“名优农产品”。 [1] \n2005年，会理石榴在第二届四川·中国西部国际农业博览会上被评为“金奖”。 [1] \n2006年，会理石榴在四川省第二届冬季旅游发展大会上获得“优质奖”。 [1] \n2007年06月26日，原国家质检总局批准对“会理石榴”实施地理标志产品保护会理石榴地理标志产品保护范围以四川省会理县人民政府《关于报送会理石榴地理标志产品保护区域有关情况的函》（会理府发〔2006〕12号）提出的范围为准，为四川省会理县鹿厂镇、彰冠乡、爱民乡、爱国乡、凤营乡、富乐乡、海潮乡、竹箐乡、通安镇、新发乡、杨家坝乡、木古乡、江普乡、芭蕉乡、关河乡、黎溪镇、河口乡、鱼鮓乡、树堡乡、绿水乡、果元乡、南阁乡等22个乡镇现辖行政区域。');
INSERT INTO `product_details` VALUES ('66', '2018110808', 'a82e9413-a8f8-4dbb-bab8-a3b4e2a7ffdc', '产品介绍四', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\videos\\1541762440540_攀西明珠会理.mp4', '关于石榴的故事传说有很多版本，但是多数版本都是说由汉代的张骞出使西域时，才将其引入内地栽植的。这里面有一段美丽传说。传说张骞到达西域安石国以后，在他住的馆驿门前，有一颗树繁花怒放色艳如火。张骞甚为喜爱，经常站在其旁观赏，后经打听得知是安石榴树。后来天旱了，石榴花叶日见枯萎。张骞不时担水浇灌，从而使其枝叶返绿榴花复艳。\n张骞完成使命后回中原时，安石国国王赠金送礼他皆不要，却请求带回那棵石榴树，国王欣然应允。不幸的是张骞在归途中遇到了匈奴人的追杀拦截，目的是阻止两国的友好邦交，在冲杀的过程当中张骞不幸将那棵石榴树失落了。当张骞人马到了长安后，汉武帝率百官出城迎接。正在此时，只见一位著红裙绿衣的妙龄女子，气吁吁、泪滴滴，向张骞奔来。\n汉武帝及文武百官皆惊，不知出了何事。张骞定睛一看，也是大吃一惊，这不是在安石国下榻时被自己哄出门的那位姑娘吗？原来，张骞起程的前一天夜里，他的房门被轻轻叩开，只见那位姑娘正向他施礼，请求与恩人一同前往中原。张骞一时弄不明白是怎么回事，暗想必是安时国的使女想随自己逃往中原，或者此女子是奸细也说不定。自己身为汗使，不能因此惹出祸端，于是将其劝出门外。不想今日她又追来，何况相隔数千里，她是怎么来的？张骞问道：“你不在安石国，千里迢迢追赶我们究竟是为何？那姑娘垂泪回答：“奴不图富贵，只求回报浇灌之恩，中途遭劫，使奴未能一路相随。”言罢忽然不见，旋即化为一棵高约三尺的花盛叶茂的石榴树。张骞恍然大悟，向汉武帝禀报了在安石国浇灌石榴树的事。汉武帝大喜，认为这是国运昌隆的吉兆，于是命花工将其移植到御花园中，从此中原大地就有了石榴树。');
INSERT INTO `product_details` VALUES ('67', '2018110809', '8be40535-f038-4222-b569-b1c74919c77e', '产品介绍一', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541768843621_timg (3).jpg', '大米中含碳水化合物75%左右，蛋白质7%-8%，脂肪1.3%-1. 8%，并含有丰富的B族维生素等。大米中的碳水化合物主要是淀粉，所含的蛋白质主要是米谷蛋白，其次是米胶蛋白和球蛋白，其蛋白质的生物价和氨基酸的构成比例都比小麦、大麦、小米、玉米等禾谷类作物高，消化率66.8%-83.1%，也是谷类蛋白质中较高的一种。\n因此，食用大米有较高的营养价值。但大米蛋白质中赖氨酸和苏氨酸的含量较少，所以不是一种完全蛋白质，其营养价值比不上动物蛋白质。但在午餐和晚餐时食用大米，较面食而言更有利于人们减肥。在我国南方地区人们一般食用大米作为主食，而在北方就有很大的不同。\n脂肪含量约1.3-1.8%，其脂肪中所含的亚油酸含量较高，一般占全部脂肪的34%，比菜籽油和茶油分别多2-5倍。\n禾（小米）、稻、稷（高粱）、麦、菽（豆）称为“五谷”。（稻即是未加工的大米）');
INSERT INTO `product_details` VALUES ('68', '2018110810', '8be40535-f038-4222-b569-b1c74919c77e', '产品介绍二', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541768852452_timg (4).jpg', '食疗药膳\n大米，又称“稻米”。分为籼米、粳米、糯米三种。大米性平，味甘。具有补中养胃、益精强志、聪耳明目、和五脏、通血脉、止烦、止渴、止泻等作用。\n大米的营养十分丰富，是中国人民的主要食粮之一。以粳米为例，在每百克粳米中，含蛋白质(蛋白质食品)6.7克，脂肪0.9克，碳水化合物77.6克，粗纤维0.3克，钙(钙食品)7毫克，磷136毫克，铁(铁食品)2.3毫克，维生素B1 0.16毫克，维生素(维生素食品)B2 0.05毫克，烟酸1毫克以及蛋氨酸125毫克，缬氨酸394毫克，亮氨酸610毫克，异亮氨酸251毫克，苏氨酸280毫克，苯丙氨酸394毫克，色氨酸122毫克，赖氨酸255毫克等多种营养物质。\n粳米能补脾、养胃、滋养、强壮。粳米粥具有补脾、和胃、清肺的功能，对病后肠胃功能较弱者，尤其是口渴、烦热之人适合食用。\n此外，煮粥时还可加入一些具有食疗作用的特殊食材，现向大家推荐了以下几种粥：\n生姜苏叶粥：生姜是对付发烧、打喷嚏、咳痰等症状的最好“武器”，也是中医常用的药材，有祛痰、祛寒、补气、除痘、平喘的作用；苏叶也有发散风寒的作用，在一般药店就可买到。具体做法是：苏叶10克、生姜3片，将白粥熬好后放入，再开锅就可食用了。\n生姜大枣粥：效果与生姜苏叶粥相似。做法是：将米放入锅中，简单干炒一下，再放入水，用勺子将米搅拌均匀后，放入大枣和生姜片，文火慢煮，直到粥煮熟，放入少许盐。需要提醒的是，这两种粥温热效果很强，幼儿、眼睛严重充血和患痔疮的人不宜食用。');
INSERT INTO `product_details` VALUES ('69', '2018110811', '8be40535-f038-4222-b569-b1c74919c77e', '产品介绍三', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541768865709_timg.jpg', '历史发展编辑\n从物种分布来看，大约在5万年前，在云南地区已经出现了早期的稻属植物。故推测亚洲最早种植稻谷的地区应该是云南地区。\n湖南道县与江西万年县考古发现，约一万三千多年前人类开始种植食用，新石器以前人类应该是口腔咀嚼全稻原谷。\n在长江下游发掘的河姆渡遗址中存在稻作证据。大米历史上最早的种稻人是长江下游的中国先民，早在7000年前，中国长江下游的原始居民已经完全掌握水稻的种植技术，并把稻米作为主要食粮。\n长江中下游河姆渡文化在约七千年以后人类进入新石器时代，杵臼发明被应用，人类知道清理分离不益食的谷壳与米糠。此后不久应该发现用水淘洗是一种更高效的去杂清理工序，淘米工序的高效去菌除氧化糠层及尘埃，人们仍在延用，杵臼制米装备直至二十世纪七十年代仍有使用。\n十九世纪未辊式米机被发明，碾米效率得以大幅度提高。二十世纪中期喷风米机问世，碾米效果得以较大的改善。\n二十世纪后期制米技术快速发展，光电色选自动清理水平不断提高，加之北方寒地粳稻种植的不断扩大，1988年免淘米在黑龙江省大庆市粮食局第二制米厂规模生产。1989年50吨/天生产线上马。');
INSERT INTO `product_details` VALUES ('70', '2018110812', '8be40535-f038-4222-b569-b1c74919c77e', '产品介绍四', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\videos\\1541762814963_大米.mp4', '我国粮食进口量将继续增长，预计全年粮食进口量将超过6000万吨，全世界出口的大都有一半将运往中国。以2011年我国粮食总产量57121万吨计算，2012年进口的粮食总量将占到我国粮食总产量的10.5%以上。\n我国人口中有65%以水稻为主食，水稻在国家粮食安全中的地位举足轻重。2010年我国粮食种植面积10987万公顷，比上年增加89万公顷，而水稻是我国最重要的粮食作物之一，全国水稻种植面积约占粮食作物面积的30%以上。2010年全国大米产量8244.4万吨，同比增长30.5%。\n随着中国城镇化进程的加快，未来至少仍将有两亿农村人口向城镇转移，城镇大米需求将大幅增长，城市消费结构改变，将间接消耗更多的粮食。\n我国大米行业的发展步伐相对于其他行业来说规模小、组织程度差。大米加工领域主要以小生产、小作坊、小商贩为主，少有大型品牌企业和领军企业，市场集中度较低。随着经济全球化程度的深入，中国巨大的市场消费力将吸引越来越多的国际大米品牌的进入，国内大米市场的竞争将会日趋激烈。\n品牌消费时代的到来催生高端大米行业。我国消费者正从日常消费品时代步入品牌消费时代，加之媒体对“毒大米、陈化粮”事件的频频曝光，更大了人们对发大米的安全和品质的注重，市场潜力和发展空间日益显著。');
INSERT INTO `product_details` VALUES ('71', '2018110813', 'd00bcb8b-c4a5-48a0-84a4-5a0717b29b06', '产品介绍一', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541768921755_timg (1).jpg', '一年生高大草本。秆直立，通常不分枝，高1-4米，基部各节具气生支柱根。叶鞘具横脉；叶舌膜质，长约2毫米；叶片扁平宽大，线状披针形，基部圆形呈耳状，无毛或具疵柔毛，中脉粗壮，边缘微粗糙。顶生雄性圆锥花序大型，主轴与总状花序轴及其腋间均被细柔毛；雄性小穗孪生，长达1厘米，小穗柄一长一短，分别长1-2毫米及2-4毫米，被细柔毛；两颖近等长，膜质，约具10脉，被纤毛；外稃及内稃透明膜质，稍短于颖；花药橙黄色；长约5毫米。雌花序被多数宽大的鞘状苞片所包藏；雌小穗孪生，成16-30纵行排列于粗壮之序轴上，两颖等长，宽大，无脉，具纤毛；外稃及内稃透明膜质，雌蕊具极长而细弱的线形花柱。颖果球形或扁球形，成熟后露出颖片和稃片之外，其大小随生长条件不同产生差异，一般长5-10毫米，宽略过于其长，胚长为颖果的1/2-2/3。染色体2n=20，40，80 （Sarma et Sharma, 1986; Molina, 1986）。花果期秋季。');
INSERT INTO `product_details` VALUES ('72', '2018110814', 'd00bcb8b-c4a5-48a0-84a4-5a0717b29b06', '产品介绍二', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541768927257_timg (3).jpg', '玉米是喜温作物，全生育期要求较高的温度。玉米生物学有效温度为10℃。种子发芽要求6—10℃，低于10℃发芽慢，16—21℃发芽旺盛，发芽最适温度为28—35℃，40℃以上停止发芽。苗期能耐短期-2-- -3℃的依温。拔节期要求15—27℃，开花期要求25—26℃，灌浆期要求20—24℃。不同玉米品种对温度的要求也不相同，我国早熟品种要求积温2000--2200℃；中熟品种2300 一2600℃；晚熟品和25OO--28OO（3000）℃。世界玉米产区多数集中在7月份等温线为21--27℃，无霜期为120—180天的范围内。玉米是短日照植物，在短日照(8--10小时)条件下可以开花结实。光谱成分对玉米的发育影响很大，据研究白天蓝色等短波光玉米发育快，而早晨或晚上以红色等长波光发育快。玉米为C4植物，具有较强的光合能力，光的饱和点高，一般玉米光合强度为35--80mgCO2/dm2·叶·小时。玉米的植株高，叶面积大，因此需水量也较多。玉米生长期间最适降水量为410—640mm，干旱影响玉米的产量和品质。一般认为夏季低于150mm的地区不适于种植玉米，而降水过多，影响光照，增加病害，倒伏和杂草危害，也影响玉米产量和品质的提高。虽然玉米需水较多，但相对需水量不太高，蒸腾系数240—370，比大麦（280一400）、燕麦（340一500）、紫花首清（831）、三叶草(797）低，耗水量较为经济。玉米有强大的根系，能充分利壤中的水分。在温度高，空气干燥时，叶片向上卷曲，减少蒸腾面积，使水分吸收与蒸腾适当平衡。玉米对土壤要求不十分严格。土质疏松，土质深厚，有机质丰富的黑钙土、栗钙土和砂质壤土，出在6一8范围内都可以种植玉米。玉米苗期能生长在含NaCl0.21%的土壤中，大于植株死亡。玉米植株含有16种元素，除C、H2O2来自CO2。和都要从土壤中吸收。需要量较大的有N、P、K、S、Ca和Mg等，需要量较少的有Fe、Mn、Zn、Cu、Ba和Cl2。等。玉米从抽雄前10天到抽华后25—30天是玉米于物质积累最快、吸肥最多的阶段，这个阶段吸收占总吸肥量 70—75%的N、60—70%的 P和 65%的K。每生产 100斤玉米籽粒需 NI．75一2．22kg、H2PO40．59--0．85kg和K2o1.5—1.84kg。三要素的比例为2.6：1：2。 [4]');
INSERT INTO `product_details` VALUES ('73', '2018110815', 'd00bcb8b-c4a5-48a0-84a4-5a0717b29b06', '产品介绍三', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541768934876_timg (4).jpg', '玉米生育期是指玉米从播种到新种子成熟所经历的天数。生育期的长短因品种、播种期、光照、温度等环境条件差异而有所不同，一般早熟品种、播种晚的和温度高的情况下，生育期短，反之则长。玉米全生育期分为播种、出苗、三叶、七叶、拔节、抽雄、开花、灌浆、乳熟、成熟等主要发育时期。播种期为播种当天日期，出苗期不全田苗高2~3厘米左右的幼苗出土达60%以上。拔节期为全田60%以上的植株基部茎节开始伸长。大喇叭口期为全田60%以上的植株上部叶片呈现喇叭口形。抽雄期为全田60%以上的植株雄穗尖端露出顶叶3~5厘米。吐丝期为全田60%以上的植株雌穗花丝露出苞叶。成熟期为全田90%以上的植株籽粒硬化，并呈现出品种固有颜色和光泽，籽粒乳线消失。玉米生长发育的过程可分为苗期、穗期和花粒期。\n苗期：指的是从出苗到拔节的时期，该期以营养生长为主，以根系建成为中心。出苗是从播种到种子发芽，在大田中有 50%的出苗，幼苗高 2 厘米的时期。\n穗期：是指从拔节到抽穗的时期。该期是营养生长与生殖生长并进，是生长最为旺盛的时期。该期又可划分为拔节期、 大喇叭口期和小喇叭口期。拔节期是幼穗分化时，在靠近地面的地方用手可以摸得到有 2~3厘米的茎节的时期。大喇叭口期是棒棒叶开始抽出，但尚未展开，形成新叶丛生，上平、 中空，状如喇叭，雌穗进入小花分化期，在上部展开的叶片和尚未展开的叶片间可以摸得到富有弹性的小穗的时期。\n花粒期：是指从抽穗到结实的时期，是以生殖生长为中心，籽粒建成的阶段。包括了抽雄期、 散粉期和结实。 [5]');
INSERT INTO `product_details` VALUES ('74', '2018110816', 'd00bcb8b-c4a5-48a0-84a4-5a0717b29b06', '产品介绍一', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\videos\\1541762851083_玉米.mp4', '我国玉米育种起始于20世纪初。1900年，京师大学堂罗振玉率先在书刊中介绍欧美玉米良种和栽培技术。随后，《农学报》开始宣传玉米良种及栽培知识。从1926年起，金陵大学的王缓等分离自交系并组配杂交种供教学使用，1930年中央大学的赵连芳等开始选育自交系，1931年山西省铭贤学校在太谷进行美国玉米品种引种试验，中选育出金皇后品种，推广种植到华北、东北、西南等各省。\n30年代初，中央农业试验所成立，它统一制定育种计划，统一征集玉米材料。还聘请美国专家任顾问和技师，开办玉米讲习班并指导玉米杂交育种工作。范福仁在广西、张连桂等在四川也开始玉米育种工作，先后选育出一些自交系和双交种。\n从1926年至1949年，中国的玉米育种研究在困难的条件下进行，所育成的一些综合种得到了广泛的推广，但是，杂交种没有在生产上应用。一是因为农民不能接受，二是在战争状态下也很难推广杂交种。相反，综合种由于不需要制种，育种速度快，产量高于农民的农家种，因此这一时期主要是推广新育成的综合种。');
INSERT INTO `product_details` VALUES ('75', '2018110817', '081bf79c-87e2-41eb-a81e-d36cc45d699d', '产品介绍二', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541769009901_timg (2).jpg', '「气味」甘，微寒，无毒。入少阴、太阳之经。\n　　甄权曰∶平，有小毒。\n　　恭曰∶小麦作汤，不许皮坼。坼则性温，不能消热止烦也。\n　　藏器曰∶小麦秋种夏熟，受四时气足，兼有寒热温凉。故麦凉、曲温、麸冷、面热，宜 其然也。河渭之西，白麦面亦凉，以其春种，阙二气也。\n　　时珍曰∶新麦性热，陈麦平和。\n　　甘、咸，寒，无毒。\n「主治」除客热，止烦渴咽燥，利小便，养肝气，止漏血唾血。令女人易孕（《别录》）\n　　。养心气，心病宜食之（思邈）。煎汤饮，治暴淋（宗 ）。熬末服，杀肠中蛔虫（《药性》）。\n　　陈者煎汤饮，止虚汗。烧存性，油调，涂诸疮汤火伤灼（时珍）。\n　　益气除热，止自汗盗汗，骨蒸虚热，妇人劳热（时珍）。');
INSERT INTO `product_details` VALUES ('76', '2018110818', '081bf79c-87e2-41eb-a81e-d36cc45d699d', '产品介绍三', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541769014225_timg (3).jpg', '「气味」甘，微寒，无毒。入少阴、太阳之经。\n　　甄权曰∶平，有小毒。\n　　恭曰∶小麦作汤，不许皮坼。坼则性温，不能消热止烦也。\n　　藏器曰∶小麦秋种夏熟，受四时气足，兼有寒热温凉。故麦凉、曲温、麸冷、面热，宜 其然也。河渭之西，白麦面亦凉，以其春种，阙二气也。\n　　时珍曰∶新麦性热，陈麦平和。\n　　甘、咸，寒，无毒。\n「主治」除客热，止烦渴咽燥，利小便，养肝气，止漏血唾血。令女人易孕（《别录》）\n　　。养心气，心病宜食之（思邈）。煎汤饮，治暴淋（宗 ）。熬末服，杀肠中蛔虫（《药性》）。\n　　陈者煎汤饮，止虚汗。烧存性，油调，涂诸疮汤火伤灼（时珍）。\n　　益气除热，止自汗盗汗，骨蒸虚热，妇人劳热（时珍）。');
INSERT INTO `product_details` VALUES ('77', '2018110819', '081bf79c-87e2-41eb-a81e-d36cc45d699d', '产品介绍四', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541769020819_timg (5).jpg', '「气味」甘，微寒，无毒。入少阴、太阳之经。\n　　甄权曰∶平，有小毒。\n　　恭曰∶小麦作汤，不许皮坼。坼则性温，不能消热止烦也。\n　　藏器曰∶小麦秋种夏熟，受四时气足，兼有寒热温凉。故麦凉、曲温、麸冷、面热，宜 其然也。河渭之西，白麦面亦凉，以其春种，阙二气也。\n　　时珍曰∶新麦性热，陈麦平和。\n　　甘、咸，寒，无毒。\n「主治」除客热，止烦渴咽燥，利小便，养肝气，止漏血唾血。令女人易孕（《别录》）\n　　。养心气，心病宜食之（思邈）。煎汤饮，治暴淋（宗 ）。熬末服，杀肠中蛔虫（《药性》）。\n　　陈者煎汤饮，止虚汗。烧存性，油调，涂诸疮汤火伤灼（时珍）。\n　　益气除热，止自汗盗汗，骨蒸虚热，妇人劳热（时珍）。');
INSERT INTO `product_details` VALUES ('87', '3fcb4920-8e8a-4674-b011-4a640b82aed1', '43ab2d25-b770-4478-8722-e85e5f18a292', '产品介绍一', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541762545178_timg (6).jpg', '猕猴桃原产中国，1904年从宜昌传到新西兰，经培育在新西兰广泛种植，起初新西兰人称它为宜昌醋栗，因名字有左派色彩在市场遇冷，后改名美龙瓜，但新西兰瓜类税收较高，最终改名为奇异果。所以奇异果就是猕猴桃的一个人工选育后的品种，皮表绒毛分布均匀，手感光滑；而它的老祖宗中华猕猴桃，绒毛分布不均，触感粗糙。');
INSERT INTO `product_details` VALUES ('88', '0748c9c4-ea74-430a-ad67-10fe1934ba8d', '43ab2d25-b770-4478-8722-e85e5f18a292', '产品介绍二', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541762552458_timg (7).jpg', '猕猴桃原产中国，本来是一种野果，直到上个世纪初，一位新西兰的女老师从湖北省宜昌市夷陵区雾渡河把它带回国 [1]  ，才发展成被称作奇异果的果品。从野生到栽培的发展过程，颇具传奇色彩。\n猕猴桃俗称阳桃、毛桃、山洋桃、毛梨桃等，是原产于中国的古老野生藤本果树。浙江省台州市黄岩区焦坑村还保存有200多年前从深山移植到田边栽植的猕猴桃植株。\n猕猴桃\n猕猴桃(5张)\n中国各地叫猕猴桃的植物有很多种，据植物学家调查，在全国分布的猕猴桃属的植物有52种以上，其中有不少种类都可以食用。现今水果市场上的猕猴桃主要是指中华猕猴桃，以及1984年由它的一个变种确定为新种的美味猕猴桃。它们的野生种类分布很广，北方的陕西、甘肃和河南，南方的两广和福建，西南的贵州、云南、四川，以及长江中下游流域的各省都有，尤以夷陵区雾渡河最多。');
INSERT INTO `product_details` VALUES ('89', 'f4603fbb-6724-4945-b080-4cf8dc7ebeb6', '43ab2d25-b770-4478-8722-e85e5f18a292', '产品介绍三', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541762563805_timg (10).jpg', '猕猴桃这个名称，很可能到唐代才出现。唐《本草拾遗》载：“猕猴桃味咸温无毒，可供药用，主治骨节风，瘫痪不遂，长年白发，痔病，等等。”说明至少在一千二百多年以前中国已经在庭院中搭架栽植猕猴桃了。除作为野果食用外，由于猕猴桃的叶和花都很漂亮，作为观赏花木在庭院栽培在唐代就开始了。唐代诗人岑参的《宿太白东溪李老舍寄弟侄》诗中有“中庭井栏上，一架猕猴桃”的句子，很形象地写出当时人们用猕猴桃美化家居的情形。同一时期《本草拾遗》的记载表明，当时已经被用作药物。\n宋开宝年间（973－974年）编纂的《开宝本草》曾记载它：“一名藤梨，一名木子，一名猕猴梨。”还说它“其形似鸡卵大，其皮褐色，经霜始甘美可食。”从这些记载中，可以看出古人是将它作为一种野果食用的。宋元丰五年（1082年），唐慎徵在《证类本草》上说：味甘酸，生山谷，藤生著树，叶圆有毛，其果形似鸭鹅卵大，其皮褐色，经霜始甘美可食。”宋政和6年（1116年），药物学家寇宗奭在《本草衍义》中记述：“猕猴桃，今永兴军（在今陕西）南山甚多，食之解实热，……十月烂熟，色淡绿，生则极酸，子繁细，其色如芥子，枝条柔弱，高二三丈，多附木而生，浅山傍道则有存者，深山则多为猴所食。”也许正是后面这个原因，才使它有猕猴桃之称。当然它在当时还有很多别名。');
INSERT INTO `product_details` VALUES ('90', '03859900-6348-45d3-98d7-1cc7ebdc4e91', '43ab2d25-b770-4478-8722-e85e5f18a292', '产品介绍四', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\videos\\1541762573597_蒲江猕猴桃.mp4', '根系生长在坚硬土层内的分布较浅；生长在疏松的土壤内的分布较深。 [2] \n猕猴桃为肉质根，根皮率高达30%～50%；根含水量高，一年生根的含水量为84%，二年生根的含水量为79%，猕猴桃主根不发达，侧根和须根发达。猕猴桃根系分布浅而广。活土层的厚度，以及温度、水分、空气、养分是影响根系生长的主要因子。一般在40～80厘米深的土层中分布最多。成年树根群体的分布范围约为树冠的3倍。\n根系猕猴桃骨干根较一般果树少，但根的导管发达，根压大，根系受伤之后，再生能力强。成年猕猴桃有50%以上的总根系长度位于30～50厘米深的表土层，90%以上根系位于1米范围内。幼年猕猴桃树的根系呈“碗形”分布，且根长度密度随深度和离树干的距离而减少。而成年树，根长度密度随深度而减小，但并不受离树干距离的远近影响。猕猴桃根系的年生长期比枝条生长期长，每年有30%以上的根系被更新。 [4]');
INSERT INTO `product_details` VALUES ('91', '6b0b370a-1e1a-4493-a80a-70e55522d039', '15caf17d-f391-4cfc-8a79-ae61acf3b0c5', '产品介绍一', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541762614265_101f35ff-5595-4072-af34-740bcefeca7b.jpg', '小乔木。枝少刺或近于无刺，嫩叶及花芽暗紫红色，翼叶宽或狭，或仅具痕迹，叶片厚纸质，卵形或椭圆形，长8-14厘米，宽4-6厘米，顶部通常短尖，边缘有明显钝裂齿。\n单花腋生或少花簇生；花萼杯状，4-5浅齿裂；花瓣长1.5-2厘米，外面淡紫红色，内面白色；常有单性花，即雄蕊发育，雌蕊退化；雄蕊20-25枚或更多；子房近筒状或桶状，顶部略狭，柱头头状。\n果椭圆形或卵形，两端狭，顶部通常较狭长并有乳头状突尖，果皮厚，通常粗糙，柠檬黄色，难剥离，富含柠檬香气的油点，瓢囊8-11瓣，汁胞淡黄色，果汁酸至甚酸，种子小，卵形，端尖；种皮平滑，子叶乳白色，通常单或兼有多胚。\n花期4-5月，果期9-11月。 [2]');
INSERT INTO `product_details` VALUES ('92', 'fbbe98cf-6fc7-4d8b-86f1-ff78b566bc0e', '15caf17d-f391-4cfc-8a79-ae61acf3b0c5', '产品介绍二', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541762621540_20150925142453_9013.jpg', '柠檬性喜温暖，耐阴，不耐寒，也怕热，因此，适宜在冬暖夏凉的亚热带地区栽培。柠檬适宜的年平均气温17-19℃，年有效积温（≥10℃）在5500℃以上，1月平均气温6-8℃，极端最低温高于-3℃；年降雨量1000毫米以上，年日照时数1000小时以上。柠檬适宜栽植于温暖而土层深厚、排水良好的缓坡地，柠檬最适宜土壤pH值是5.5-7.0之间。柠檬植株生长较快，植株高达3-6米，需肥量较大，一年多次抽梢、开花、结果，常因管理好坏而产量差异较大。 [5]');
INSERT INTO `product_details` VALUES ('93', '23e4a078-ac58-47ee-ac17-6df0b79517fe', '15caf17d-f391-4cfc-8a79-ae61acf3b0c5', '产品介绍三', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541762659204_timg (5).jpg', 'Eureka（尤力克）\n尤力克\n尤力克\n又称油力克、油利加，原产美国，是目前世界上栽培最广泛的品种，果实椭圆形至倒卵形，果实中大，单果重90~160g长椭圆形，顶部有乳头状凸起，基部钝圆，有放射状沟纹。果皮淡黄色，油胞大，正常管理水平下表现皮薄，少核。\nFino（菲诺）\n又称mesero或primofiori，起源于西班牙，澳大利亚主栽品种。果实大小适中，球形或椭圆形，色泽呈浅黄色或黄色，皮薄且光滑，高酸。\nVerna（维尔拉）\n西班牙晚熟品种，少刺，果大，少核，椭圆形。果颈突出，果面黄色，果皮质地粗糙，果肉细嫩。\nInerdonato（印度大果）\n柠檬和圆佛手柑的杂种，土耳其的主栽及主要出口品种。果实椭圆形至圆形，果面光滑、皮薄，平均单果重108g，成熟时色泽黄绿色。\nVillafranca（维拉法兰卡）');
INSERT INTO `product_details` VALUES ('94', '17c6065f-ec78-47c5-96f9-3b19f08425c6', '15caf17d-f391-4cfc-8a79-ae61acf3b0c5', '产品介绍四', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\videos\\1541762669618_柠檬酱.mp4', '繁殖方法编辑\n柠檬繁殖的方法分为有性繁殖和无性繁殖两大类。有性繁殖由种子播种培育而来，又叫实生苗；无性繁殖由柠檬的部分营养器官培养而来，又叫营养繁殖，有嫁接、扦插、压条、组织培养等方法，其中以嫁接繁殖最为普遍。\n种子繁殖\n选择生长健壮、无病虫害的柠檬植株为采种母树，在11-12月果实充分成熟时采摘柠檬果，放置几天后剖开果实，取出种子漂洗干净，立即播种；或保存在果实中，待春季再取出种子播种，干种子不宜久藏，容易丧失发芽力，鲜种子在15-25℃变温条件下，仅7天即可发芽。 [7] \n嫁接繁殖\n嫁接前应在品种纯正、无病虫危害、丰产稳产的柠檬树上采集一年生木质化春梢或秋梢作为接穗，常用的嫁接方法有切接法、腹接法、芽接法等几种。\n切接\n春季多采用切接。在树液开始流动时嫁接效果较好，四川、重庆地区在雨水节前后半个月都可嫁接，广东在立春后40天内嫁接的成活率高。在气温低的年份，嫁接时间可推迟至5月份。切接操作简便、发芽快、生长迅速，当年可以达到出圃规格，秋季或翌年春季可进行定植。\n腹接');
INSERT INTO `product_details` VALUES ('95', 'e778c715-d86e-45f8-979e-abbb6024871a', '7015c869-a82f-43e7-9f90-14a5ef5a1a42', '产品介绍一', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541762734651_mango01.jpg', '常绿大乔木，高10-20米；树皮灰褐色，小枝褐色，无毛。叶薄革质，常集生枝顶，叶形和大小变化较大，通常为长圆形或长圆状披针形，长12-30厘米，宽3.5-6.5厘米，先端渐尖、长渐尖或急尖，基部楔形或近圆形，边缘皱波状，无毛，叶面略具光泽，侧脉20-25对，斜升，两面突起，网脉不显，叶柄长2-6厘米，上面具槽，基部膨大。\n圆锥花序长20-35厘米，多花密集，被灰黄色微柔毛，分枝开展，最基部分枝长6-15厘米；苞片披针形，长约1.5毫米，被微柔毛；花小，杂性，黄色或淡黄色；花梗长1.5-3毫米，具节；萼片卵状披针形，长2.5-3毫米，宽约1.5毫米，渐尖，外面被微柔毛，边缘具细睫毛；花瓣长圆形或长圆状披针形，长3.5-4毫米，宽约1.5毫米，无毛，里面具3-5条棕褐色突起的脉纹，开花时外卷；花盘膨大，肉质，5浅裂；雄蕊仅1个发育，长约2.5毫米，花药卵圆形，不育雄蕊3-4，具极短的花丝和疣状花药原基或缺；子房斜卵形，径约1.5毫米，无毛，花柱近顶生，长约2.5毫米。\n核果大，肾形（栽培品种其形状和大小变化极大），压扁，长5-10厘米，宽3-4.5厘米，成熟时黄色，中果皮肉质，肥厚，鲜黄色，味甜，果核坚硬。 [2]');
INSERT INTO `product_details` VALUES ('96', '18fe7874-e51b-4a19-9f04-326b731d79fa', '7015c869-a82f-43e7-9f90-14a5ef5a1a42', '产品介绍二', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541762721521_timg (4).jpg', '枝梢生长习性芒果枝梢呈蓬次式生长，芽由苞片包裹，生长时苞片先绽开，芽梢伸长，叶片开展，苞片随即脱落。中、下部叶片互生，叶距较大。一般苗期和幼树每年抽6-8次梢，幼龄结果树抽2-4次，成龄树1-2次。3-5月抽生的枝梢为春梢，6-8且为夏梢，9-11月为秋梢，12-2月为冬梢。在海南秋梢是主要结果母枝。但春、夏梢也可成为结果母枝，在条件良好的情况下，某些品种在12-1月抽生的冬梢也能开花结果.从芽萌动至枝梢停止生长、叶片老熟历时15-35天。夏、秋梢历时较短，冬梢较长。枝梢生长与根系生长交替进行。\n开花结果\n花芽\n花芽分化在正常情况下，芒果花芽分化从10月下旬至11月开始。使用催花剂则任何时候都可能分化。从花芽分化至花序的第一朵花开放历时20-39天，但第一朵花开放后花序还在继续伸长。适当的低温干旱有利于花芽分化；气温高有利于两性花的形成。');
INSERT INTO `product_details` VALUES ('97', '50958742-01b1-4f97-af64-e1004f7977a7', '7015c869-a82f-43e7-9f90-14a5ef5a1a42', '产品介绍三', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541762742554_timg (1).jpg', '开花\n芒果树自然开花在每年12月至次年1-2月，有时会早至11月或迟到次年3月，盛花期在春节前后。一个花序从第一朵花开放至全花序开放完毕需15-25天，一株树的花期约50天。芒果花有两性花与雄花，两性花有发育正常的雄蕊和雌蕊，可进行正常的传粉受精和结实；雄花没有雌蕊，开花后不能结实。多数栽培品种两性花占15%以上。一朵花从花瓣展开至柱头干枯约1.5天。\n果实\n果实发育开花受精后子房开始膨大，约经1.5个月后迅速增大，采果前10-15天增长极缓慢或不增长，这时主要是增厚、充实、增重。从开花稔实至果实青熟，早熟种需85-110天，中熟种100-120天，迟熟种120-150天。在果实发育期间有两次明显的落果高峰：第一次在花后两周左右，主要是受精不良的小果枯黄脱落，落果量较大；第二次在花后4-7周，除小部份是发育不良的畸形果或败育果外，而更多是因养分和水分不足造成落果。花后2.5个月以后很少再发生生理落果，到80-85天只有风害、裂果或病虫害才招致落果。果实收获期在5-7月，因品种和地区而异。');
INSERT INTO `product_details` VALUES ('98', '2ceb0c49-dbc3-46f3-b9bd-53a6e480d10c', '7015c869-a82f-43e7-9f90-14a5ef5a1a42', '产品介绍四', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\videos\\1541762749474_攀枝花芒果.mp4', '温度\n在树上没有熟的芒果\n在树上没有熟的芒果(13张)\n芒果性喜温暖，不耐寒霜。温度最适生长温度为25-30℃，低于20℃生长缓慢，低于10℃叶片、花序会停止生长，近成熟的果实会受寒害。世界芒果生产区年均温在20℃以上，最低月均温大于15℃。中国能正常生长结果的产区年均温为19.8-24.1℃，但以年均温21-22℃，最冷月大于15℃，几乎全年无霜的地区为多。芒果生长的有效温度为18-35℃、枝梢生长的适温为24-29℃、坐果和幼果生长需大于20℃的日均温。\n温度不足，授粉受精不良，甚至花序枯死或种胚败育死亡。气温高于37℃时，小花和果实产生日灼，低于10℃，新梢及花穗停止生长，5℃以下，幼苗、嫩梢和花穗受寒，0℃左右幼苗地上部、成年树的花穗和嫩梢、外围叶片都会受害，严重时枯死。-3℃以下幼树冻死，大树严重受冻。\n光照');
INSERT INTO `product_details` VALUES ('99', '450de25a-a04b-4868-802e-0a430fbaa285', '179401dc-f708-4e08-b6aa-57fcc0afea99', '产品介绍一', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541763842150_timg (3).jpg', '20世纪70年代以后，中国在油菜杂种优势利用方面做了大量的研究工作，在国际上首先发现具有实用价值的玻里马（Polima）油菜细胞质雄性不育系，并首先实现了三系配套。通过对细胞质雄性不育、细胞核雄性不育、自交不亲和、化学杀雄、天然杂交、孤雄生殖及辐射育种方法的研究，选育出了一批在生产上发挥重要作用的油菜新品种，如甘油5号、湘油5号等。统计表明，中国油菜的种植面积、单产水平和年均总产50年代分别为2903.5万亩、30.9公斤/亩和88.7万吨。\n江西婺源思溪延村油菜花\n江西婺源思溪延村油菜花(6张)\n60年代分别为2381.5万亩、32.0公斤/亩和78.6万吨。70年代分别为3214.8万亩、45.4公斤/亩和146.4万吨。1979年达到240.2万吨，首次超过中国历史上最高的1934年产量190.7万吨；80年代是中国油菜生产的快速增长时期，由于中油821、秦油2号等丰产性好、抗（耐）病性较强的甘蓝型品种的推广与应用，使中国油菜单产迈上了一个新的台阶，种植面积、单产水平和年均总产分别为6368.3万亩、76.7公斤/亩和488.4万吨，分别比70年代增长98.1%、68.9%和233.6%，实现了中国油菜向高产、稳产、高抗转变的第二次革命。');
INSERT INTO `product_details` VALUES ('100', '4468e61d-4eb5-4d1a-be5b-901b9b94f7f8', '179401dc-f708-4e08-b6aa-57fcc0afea99', '产品介绍二', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\videos\\1541763763226_油菜02.mp4', '进入90年代，无论是种植面积、单产水平和总产量均继续保持快速增长的势头。20世纪90年代的前8年（1990～1997年）平均为9152.2万亩、88.5公斤/亩和812.9万吨，分别比20世纪80年代增长43.7%、15.4%和66.4%。值得一提的是经过全国20多个科研单位近二十年的协作科技攻关以及中国一加拿大或澳大利亚、美国等重大国际合作研究，中双四号、华杂4号、油研7号、中油杂1号等一批优质双低新品种已陆续开始大面积推广应用，现已育成40余个熟期、产量和抗性接近或达到常规双高品种水平的双低油菜品种或组合。至1998年，全国双低油菜面积已接近3000万亩，揭开了中国油菜生产由单一的产量型向产量、质量结合型转变的序幕，开始实现油菜品种向优质高效转变的第三次革命。');
INSERT INTO `product_details` VALUES ('101', 'ead8450e-3013-4273-9dab-26315b81d79b', '179401dc-f708-4e08-b6aa-57fcc0afea99', '产品介绍三', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541762893686_timg (5).jpg', '植株笔直丛生，茎绿花黄，基生叶呈旋叠状生长，茎生叶，一般是互生，没有托叶。花两性，辐射对称，花瓣4枚，呈十字形排列，花片质如宣纸，嫩黄微薄。雄蕊通常6枚，4长2短，通常称为“四强雄蕊”，雌蕊由二心皮构成，子房位置靠上。茎圆柱形，直径大多在0.1-0.8厘米之间，多分枝，茎杆较软；叶互生，叶大，浓绿色，无叶柄及托。三、四月间，茎梢着花，花为总状花序，花萼片四片，黄绿色，花冠四瓣，黄色，呈十字形。果实为长角果，到夏季，成熟时开裂散出种子，紫黑色，也有黄色。\n油菜花四片花瓣，整齐地围绕着花蕊，朴实个性。花瓣十分精致，有细细的纹路，那是技艺多么高超的雕刻家也无法雕琢出来的。中间的花蕊弯曲着凑在一块，仿佛在说着悄悄话。它有坚韧的根茎，茂密的叶，有着像栽种它们的农民们一样的淳朴与粗犷。');
INSERT INTO `product_details` VALUES ('102', '026d2e32-dab4-4c6e-834f-f77a732f52e5', '179401dc-f708-4e08-b6aa-57fcc0afea99', '产品介绍四', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\videos\\1541762899034_油菜花.mp4', '中国油菜产业的发展油菜是中国最重要的油料作物， [5]  种子含油量为33%～50%。自1995年以来，常年种植面积在1亿亩，年产菜籽近1000万吨，占油料作物总产量的40%～45%（不含大豆）；同时还生产约600万吨的菜籽饼粕。饼粕蛋白质含量高达40%，菜籽蛋白质的氨基酸组成合理，其赖氨酸含量与大豆相当，而赖氨酸、蛋氨酸等含硫氨基酸的含量则高于大豆蛋白质，是中国有待开发利用的最大宗优质饲用蛋白源。油菜除用作榨取食用油和饲料之外，在食品工业中还可制作人造奶油、人造蛋白。还在冶金、机械、橡胶、化工、油漆、纺织、制皂、造纸、皮革和医药等方面都有广泛的用途，具有重要的经济价值。');
INSERT INTO `product_details` VALUES ('103', 'ce2cba3c-950f-44f3-9b35-cceb5719598f', '350eda07-7d54-4561-a311-ff35e0c30384', '产品介绍一', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541763639429_timg (2).jpg', '特点编辑\n花椒属芸香料灌木或小乔木植物，有刺。奇数羽状复叶，边缘有圆齿和透明腺点。夏 季开花，花小型，伞房花序或短圆锥花序。果实呈红色，种子黑色。果实就是花椒， 含挥发油，性热，味辛香。\n功效编辑\n花椒是烹调中的重要调味品，主要用于烹煮肉类，也常作为炒椒盐花生、椒盐豆，制 中式椒盐饼等。另外，它也是调制其它调味品的常用原料。');
INSERT INTO `product_details` VALUES ('104', '6ef6d8c6-f6d2-4e4b-a93e-a0d68d478245', '350eda07-7d54-4561-a311-ff35e0c30384', '产品介绍二', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\images\\1541763643346_timg.jpg', '花椒（学名：Zanthoxylum bungeanum Maxim.）是芸香科、花椒属落叶小乔木，高可达7米；茎干上的刺，枝有短刺，当年生枝被短柔毛。叶轴常有甚狭窄的叶翼；小叶对生，卵形，椭圆形，稀披针形，叶缘有细裂齿，齿缝有油点。叶背被柔毛，叶背干有红褐色斑纹。花序顶生或生于侧枝之顶，花被片黄绿色，形状及大小大致相同；花柱斜向背弯。果紫红色，散生微凸起的油点，花期4-5月，果期8-9月或10月。\n分布北起东北南部，南至五岭北坡，东南至江苏、浙江沿海地带，西南至西藏东南部；台湾、海南及广东不产。见于平原至海拔较高的山地，在青海，海拔2500米的坡地也有栽种。耐旱，喜阳光，各地多栽种。\n花椒的木材为典型的淡黄色，露于空气中颜色稍变深黄，心边材区别不明显，木质部结构密致，均匀，纵切面有绢质光泽，大材有美术工艺价值。孤植又可作防护刺篱。其果皮可作为调味料，并可提取芳香油，又可入药，种子可食用，也可加工制作肥皂。\n花椒用作中药，有温中行气、逐寒、止痛、杀虫等功效。治胃腹冷痛、呕吐、泄泻、血吸虫、蛔虫等症。又作表皮麻醉剂。 [1]');
INSERT INTO `product_details` VALUES ('105', 'fd0a05bc-33e2-4fce-96bf-35fb41a840a1', '350eda07-7d54-4561-a311-ff35e0c30384', '产品介绍三', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\videos\\1541763658699_花椒01.mp4', '高3-7米的落叶小乔木；茎干上的刺常早落，枝有短刺，小枝上的刺基部宽而扁且劲直的长三角形，当年生枝被短柔毛。\n叶有小叶5-13片，叶轴常有甚狭窄的叶翼；小叶对生，无柄，卵形，椭圆形，稀披针形，位于叶轴顶部的较大，近基部的有时圆形，长2-7厘米，宽1-3.5厘米，叶缘有细裂齿，齿缝有油点。其余无或散生肉眼可见的油点，叶背基部中脉两侧有丛毛或小叶两面均被柔毛，中脉在叶面微凹陷，叶背干后常有红褐色斑纹。\n花序顶生或生于侧枝之顶，花序轴及花梗密被短柔毛或无毛；花被片6-8片，黄绿色，形状及大小大致相同；雄花的雄蕊5枚或多至8枚；退化雌蕊顶端叉状浅裂；雌花很少有发育雄蕊，有心皮3或2个，间有4个，花柱斜向背弯。\n果紫红色，单个分果瓣径4-5毫米，散生微凸起的油点，顶端有甚短的芒尖或无；种子长3.5-4.5毫米。花期4-5月，果期8-9月或10月。 [3]');
INSERT INTO `product_details` VALUES ('106', 'bfcf7014-e6a7-4301-be71-8ed9c57ad648', '350eda07-7d54-4561-a311-ff35e0c30384', '产品介绍四', 'http:\\\\localhost:8080\\SiChuanMarket_SSM\\static\\videos\\1541763665094_花椒02.mp4', '毛叶花椒（变种）ZanthoxylumbungeanumMaxim. var.pubescensHuang\n新生嫩枝、叶轴及花序轴、小叶片两而均被柔毛，有时果梗及小叶腹面无毛。本变种分为二类，一类的小叶薄纸质，干后两而颜色明显不同，叶背淡灰白色，果梗纤细而延长；另一类的小叶厚纸质，叶面及果梗无毛，侧脉在叶面凹陷呈细裂沟状，小叶两面近于同色，干后红棕色，果梗较粗。花期5-6月，果期10-11月。产青海（循化）、甘肃、陕西南部、四川西部及西北部（理县、黑水、茂县、宝兴等县）。见于海拔2500-3200米山地。 [3]');
INSERT INTO `product_info` VALUES ('18', '06c792e2-0e6d-4a1a-a808-ef0faeca2f26', '龙泉水蜜桃', '龙泉驿区是全国三大水蜜桃生产基地之一，龙泉驿区水蜜桃以其果大、质优，外观艳丽，具有“白里透红、水份饱满、汁多味甜”的特性，素有天下第一桃之称，荣获世界园艺博览会银奖、中国国际农业博览会金奖、四川省名优果称号。2008年，龙泉驿区水蜜桃成功入选“2008奥运推荐果品”。主要品种有春蕾、京春、早香玉（北京27号）、庆丰（北京28号）、白凤、皮球桃、京艳、龙泉晚白桃等20余个，产品从5月中下旬上市，到10月初结束，供应期达120多天。', , '401');
INSERT INTO `product_info` VALUES ('19', 'a82e9413-a8f8-4dbb-bab8-a3b4e2a7ffdc', '会理石榴', '会理是中国石榴之乡，无论土壤、气候还是光照，都非常适宜于石榴生长。会理石榴生长快、结果早、产量高，一般在种植后第三年就开花结果，进入盛果期后，单株产量50至100千克，最高可达250至300千克；成熟期比其他产区提早30—50天。同时，会理石榴因果大皮薄、色泽艳丽、粒大籽软、味甜汁多、富含多种维生素及28种氨基酸。', , '401');
INSERT INTO `product_info` VALUES ('20', '8be40535-f038-4222-b569-b1c74919c77e', '井研大米', '大米（Rice），是稻谷经清理、砻谷、碾米、成品整理等工序后制成的成品。 稻谷的胚与糊粉层中含有近64%的稻米营养和90%以上的人体所须的营养元素，是南方人民的主要食品。中医认为大米味甘性平，具有补中益气、健脾养胃、益精强志、和五脏、通血脉、聪耳明目止烦、止渴、止泻的功效，称誉为“五谷之首”，是中国的主要粮食作物，约占粮食作物栽培面积的四分之一。世界上有一半人口以大米为主食。\n大米，入脾、胃、肺经，具有补中益气、滋阴润肺、健脾和胃、除烦渴的作用。古代养生家还倡导“晨起食粥”以生津液，因此，因肺阴亏虚所致的咳嗽、便秘患者可早晚用大米煮粥服用。经常喝点大米粥有助于津液的生发，可在一定程度上缓解皮肤干燥等不适。煮粥时若加点梨，中医养生效果更好。', , '402');
INSERT INTO `product_info` VALUES ('21', 'd00bcb8b-c4a5-48a0-84a4-5a0717b29b06', '四川玉米', '玉米（拉丁学名：Zea mays L.）是禾本科玉蜀黍属一年生草本植物。别名：玉蜀黍、棒子、包谷、包米、包粟、玉茭、苞米、珍珠米、苞芦、大芦粟，东北辽宁话称珍珠粒，潮州话称薏米仁，粤语称为粟米，闽南语称作番麦。\n玉米是一年生雌雄同株异花授粉植物， 植株高大， 茎强壮， 是重要的粮食作物和饲料作物， 也是全世界总产量最高的农作物， 其种植面积和总产量仅次于水稻和小麦。玉米一直都被誉为长寿食品， 含有丰富的蛋 白质、 脂肪、 维生素、 微量元素、 纤维素等， 具有开发高营养、 高生物学功能食品的巨大潜力。但由于其遗传性较为复杂， 变异种类丰富， 在常规的育种过程中存在着周期过长、 变异系数过大、 影响子代生长发育的缺点， 而现代生物育种技术不但克服了上述缺点和不足， 同时也提高了育种速度和质量。 [1]', , '402');
INSERT INTO `product_info` VALUES ('22', '081bf79c-87e2-41eb-a81e-d36cc45d699d', '四川小麦', '小麦是小麦系植物的统称，是单子叶植物，是一种在世界各地广泛种植的禾本科植物，小麦的颖果是人类的主食之一，磨成面粉后可制作面包、馒头、饼干、面条等食物；发酵后可制成啤酒、酒精、白酒（如伏特加），或生质燃料。小麦富含淀粉、蛋白质、脂肪、矿物质、钙、铁、硫胺素、核黄素、烟酸、维生素A及维生素C等。\n小麦是三大谷物之一，几乎全作食用，仅约有六分之一作为饲料使用。两河流域是世界上最早栽培小麦的地区，中国是世界最早种植小麦的国家之一。2010年小麦是世界上总产量位居第二的粮食作物(6.51亿吨)，仅次于玉米(8.44亿吨)。', , '402');
INSERT INTO `product_info` VALUES ('25', '43ab2d25-b770-4478-8722-e85e5f18a292', '蒲江猕猴桃', '猕猴桃（学名：Actinidia chinensis Planch），也称奇异果（奇异果是猕猴桃的一个人工选育品种，因使用广泛而成为了猕猴桃的代称）。世界猕猴桃原产地在中国湖北省宜昌市夷陵区雾渡河镇 [1]  ，2008年11月6日，在新西兰举行的国际猕猴桃大会上，世界19个国家200多位专家一致认定：中国是猕猴桃的原生中心，世界猕猴桃原产地在湖北宜昌市夷陵区雾渡河镇 [1]  。\n果形一般为椭圆状，早期外观呈绿褐色，成熟后呈红褐色，表皮覆盖浓密绒毛，果肉可食用，其内是呈亮绿色的果肉和一排黑色或者红色的种子。因猕猴喜食，故名猕猴桃；亦有说法是因为果皮覆毛，貌似猕猴而得名，是一种品质鲜嫩，营养丰富，风味鲜美的水果。\n猕猴桃的质地柔软，口感酸甜。味道被描述为草莓、香蕉、菠萝三者的混合。猕猴桃除含有猕猴桃碱、蛋白水解酶、单宁果胶和糖类等有机物，以及钙、钾、硒、锌、锗等微量元素和人体所需17种氨基酸外，还含有丰富的维生素C、葡萄酸、果糖、柠檬酸、苹果酸、脂肪。', , '401');
INSERT INTO `product_info` VALUES ('26', '15caf17d-f391-4cfc-8a79-ae61acf3b0c5', '安岳柠檬', '柠檬（学名：Citrus limon (L.) Burm. f.），为双子叶植物纲芸香科柑橘属植物，柠檬又称柠果、洋柠檬、益母果等。 [1]  小乔木，枝少刺或近于无刺，嫩叶及花芽暗紫红色，叶片厚纸质，卵形或椭圆形。单花腋生或少花簇生。果椭圆形或卵形，果皮厚，通常粗糙，柠檬黄色，果汁酸至甚酸，种子小，卵形，端尖；种皮平滑，子叶乳白色，通常单或兼有多胚。花期4-5月，果期9-11月。\n柠檬产中国长江以南， [2]  原产东南亚，主要产地为美国、意大利、西班牙和希腊。 [3] \n柠檬因其味极酸，肝虚孕妇最喜食，故称益母果或益母子。柠檬中含有丰富的柠檬酸，因此被誉为“柠檬酸仓库”。它的果实汁多肉脆，有浓郁的芳香气。因为味道特酸，故只能作为上等调味料，用来调制饮料菜肴、化妆品和药品。 [1]  此外，柠檬富含维生素C，能化痰止咳，生津健胃。用于支气管炎，百日咳，食欲不振，维生素缺乏，中暑烦渴等症状，它是\"坏血病\"的克星。', , '401');
INSERT INTO `product_info` VALUES ('27', '7015c869-a82f-43e7-9f90-14a5ef5a1a42', '攀枝花芒果', '芒果是杧果 [1]  （中国植物志）的通俗名（拉丁学名：Mangifera indica L.），芒果是一种原产印度的漆树科常绿大乔木，叶革质，互生；花小，杂性，黄色或淡黄色，成顶生的圆锥花序。核果大，压扁，长5-10厘米，宽3-4.5厘米，成熟时黄色，味甜，果核坚硬。\n芒果为著名热带水果之一，芒果果实含有糖、蛋白质、粗纤维，芒果所含有的维生素A的前体胡萝卜素成分特别高，是所有水果中少见的。其次维生素C含量也不低。矿物质、蛋白质、脂肪、糖类等，也是其主要营养成分。可制果汁、果酱、罐头、腌渍、酸辣泡菜及芒果奶粉、蜜饯等。', , '401');
INSERT INTO `product_info` VALUES ('28', '179401dc-f708-4e08-b6aa-57fcc0afea99', '四川菜籽油', '新中国成立以来，油菜作为最主要的油料和经济作物发展稳中有升，新品种推广实现了三次革命。建国初期通过品种评选推广的一些油菜优良品种如七星剑、江西婺源篁（huáng）岭 [2]  和江西婺源江岭 [3]  油菜花，江岭油菜、兴化油菜、浠水白等，对中国油菜生产的恢复与发展起到了极大的促进作用。\n20世纪50年代中期以后，中国开始推广从国外引进的甘蓝型油菜—胜利油菜 [4]  ，并以系统选育为主，选育出一批适合于中国多熟制栽培的甘蓝型油菜品种，实现了中国油菜品种由白菜型向甘蓝型转变的第一次革命。', , '403');
INSERT INTO `product_info` VALUES ('29', '350eda07-7d54-4561-a311-ff35e0c30384', '四川花椒', '汉源县的清溪和富林乡， 有“花椒之乡”的称誉，这里的产品取名“清溪椒”（又称“贡椒”）、富林椒，颗粒饱 满，色艳肉厚，油重质佳，麻香味浓。“大红袍花椒”又名“西路花椒”，产于汶川、 金川、平武等地，这种花椒粒大色红，肉厚油重，麻香兼优，故名“大红袍”。此外， 还有“小路椒”、“金阳椒”、“转红椒”、“\n高足椒”、“青椒”、“野椒”、“臭椒”等等， 都是调味佳品。', , '406');
